def count_grass(matrix):
   count_grass = 0
   for i in range(len(matrix)):
      for j in range(len(matrix[0])):
         if(matrix[i][j] == "*"):
            count_grass += 1
   return count_grass


def reverse_matrix(matrix):
   new_matrix = []
   for line in matrix:
      new_matrix.append(line[::-1])
   return new_matrix
      


